import React from 'react';
import logo from './logo.svg';
import './App.css';

const Todo =({todo}) => <li>{todo}</li>;

const Todos = ({todos}) => <ul>
  {todos.map(todo => <Todo todo={todo} />)}
</ul>

const todos = [
  'jack',
  'jack2'
]

function App() {
  return (
    <div className="App">
      <Todos todos={todos}/>
    </div>
  );
}

export default App;
